        for(uint i=0; i<voteCount; i++){
            if((votes[i].VpollId == _pollId) && (votes[i].voter == _voter)) {
                has = true;
            }
        }
        return has;
    }

    function getAllPolls() public view returns (PollStruct[] memory) {
